import React from "react";
import "./App.css";
import About from "./About";
import Portfolio from "./Portfolio";
import Nav from "./Nav";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <Nav />
        <Routes>
          <Route path="/portfolio" component={Portfolio} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
